export const setUsername = (username) => {
  return (dispatch) => {
    dispatch({
      type: "newuser",
      payload: username,
    });
  };
};
export const resetUser = () => {
  return (dispatch) => {
    dispatch({
      type: "resetuser",
      payload: "",
    });
  };
};
